import React, { useEffect, useState } from "react";
import { Container, Form, Button, Alert, Spinner } from "react-bootstrap";
import { useNavigate } from "react-router-dom";
import axios from "axios";

const Dashboard = () => {
  const navigate = useNavigate();
  const [formData, setFormData] = useState({
    skills: "",
    educationLevel: "",
    degree: "",
    experience: "",
    jobRole: "",
  });
  const [response, setResponse] = useState(null);
  const [loading, setLoading] = useState(false);
  const [user, setUser] = useState(null);

  useEffect(() => {
    // Get user data from localStorage
    const userData = JSON.parse(localStorage.getItem("user"));
    const token = localStorage.getItem("token");

    // If no token or user data, redirect to login page
    if (!token || !userData) {
      alert("Please log in first!");
      navigate("/"); // Redirect to login page
    }

    // Set the user data in state
    setUser(userData);
  }, [navigate]);

  const handleChange = (e) => setFormData({ ...formData, [e.target.name]: e.target.value });

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setResponse(null);

    try {
      const res = await axios.post("http://localhost:5000/career/career-recommendation", formData, {
        headers: {
          Authorization: `Bearer ${localStorage.getItem("token")}`,
        },
      });
      setResponse(res.data.recommendations);
    } catch (error) {
      setResponse("Error fetching career recommendations.");
    } finally {
      setLoading(false);
    }
  };

  return (
    <Container className="dashboard-container">
      <div className="dashboard-header">
        <h2>Your Skill Dashboard</h2>
        <p className="text-muted">Analyze your skills and bridge your career gap with AI-driven insights</p>
      </div>

      <div className="row">
        {/* Left Column - User Profile */}
        <div className="col-lg-4">
          {/* User Profile Card */}
          <div className="dashboard-card">
            <div className="profile-section">
              <div className="profile-avatar">
                <span className="avatar-initial">
                  {user ? user.firstName.charAt(0) : "U"}
                </span>
              </div>
              <div className="profile-info">
                <h5 className="profile-name">{user ? user.firstName + " " + user.lastName : "User"}</h5>
                <p className="profile-role">Professional Role</p>
              </div>
            </div>
            <div className="progress">
              <div className="progress-bar" role="progressbar" style={{ width: "65%" }}></div>
            </div>
            <p className="text-muted text-center">Profile Completion: 65%</p>
            <div className="d-grid gap-2 mt-3">
              <Button variant="outline-primary">Edit Profile</Button>
            </div>
          </div>
        </div>

        {/* Right Column - Skill Form and Results */}
        <div className="col-lg-8">
          {/* Skill Analysis Form */}
          <div className="dashboard-card">
            <h5 className="card-title">Skill Gap Analysis</h5>
            <Form onSubmit={handleSubmit}>
              <Form.Group className="mb-3">
                <Form.Label>Your Skills</Form.Label>
                <Form.Control
                  as="textarea"
                  name="skills"
                  rows={3}
                  value={formData.skills}
                  onChange={handleChange}
                  placeholder="Enter your skills separated by commas (e.g., JavaScript, UI/UX Design, Project Management)"
                />
              </Form.Group>

              <Form.Row>
                <Form.Group as={Form.Col} md={6} className="mb-3">
                  <Form.Label>Education Level</Form.Label>
                  <Form.Control
                    as="select"
                    name="educationLevel"
                    value={formData.educationLevel}
                    onChange={handleChange}
                  >
                    <option value="">Select your education level</option>
                    <option value="High School">High School</option>
                    <option value="Associate's Degree">Associate's Degree</option>
                    <option value="Bachelor's Degree">Bachelor's Degree</option>
                    <option value="Master's Degree">Master's Degree</option>
                    <option value="PhD">PhD</option>
                  </Form.Control>
                </Form.Group>

                <Form.Group as={Form.Col} md={6} className="mb-3">
                  <Form.Label>Degree/Field of Study</Form.Label>
                  <Form.Control
                    type="text"
                    name="degree"
                    value={formData.degree}
                    onChange={handleChange}
                    placeholder="E.g., Computer Science, Business"
                  />
                </Form.Group>
              </Form.Row>

              <Form.Row>
                <Form.Group as={Form.Col} md={6} className="mb-3">
                  <Form.Label>Years of Experience</Form.Label>
                  <Form.Control
                    as="select"
                    name="experience"
                    value={formData.experience}
                    onChange={handleChange}
                  >
                    <option value="">Select years of experience</option>
                    <option value="0-1">0-1 years</option>
                    <option value="1-3">1-3 years</option>
                    <option value="3-5">3-5 years</option>
                    <option value="5-10">5-10 years</option>
                    <option value="10+">10+ years</option>
                  </Form.Control>
                </Form.Group>

                <Form.Group as={Form.Col} md={6} className="mb-3">
                  <Form.Label>Desired Job Role</Form.Label>
                  <Form.Control
                    type="text"
                    name="jobRole"
                    value={formData.jobRole}
                    onChange={handleChange}
                    placeholder="E.g., Data Scientist, UX Designer"
                  />
                </Form.Group>
              </Form.Row>

              <div className="d-grid gap-2 mt-3">
                <Button variant="primary" type="submit" disabled={loading}>
                  {loading ? <Spinner animation="border" size="sm" /> : "Analyze My Skills"}
                </Button>
              </div>
            </Form>
          </div>

          {/* Career Recommendations */}
          {response && (
            <div className="dashboard-card">
              <h5 className="card-title">Your Career Recommendations</h5>
              <div>
                <p>{response}</p>
              </div>
            </div>
          )}
        </div>
      </div>
    </Container>
  );
};

export default Dashboard;
